import React from 'react';

const LoginPage = () => {
  return (
    <div className="flex h-screen bg-[#fef6d8] items-center justify-center">
      {/* We'll make sure this is the only flex container so it's centered */}
      <form className="bg-white p-10 rounded-2xl shadow-2xl w-full max-w-xs mx-auto">
        <h1 className="text-3xl font-bold mb-8 text-center">Volunteer Management System</h1>

        {/* Email input */}
        <div className="mb-4 mx-auto">
          <input className="w-full px-3 py-2 border rounded-xl " type="email" placeholder="Email" />
        </div>

        {/* Password input */}
        <div className="mb-4 mx-auto">
          <input className="w-full px-3 py-2 border rounded-xl" type="password" placeholder="Password" />
        </div>

        {/* Buttons */}
        <div className="flex justify-between mb-4">
          <button className="bg-[#fcd137] hover:bg-blue-700 text-black font-bold py-2 px-4 rounded w-1/2 mr-2">Log In</button>
          <button className="bg-[#fcd137] hover:bg-green-700 text-black font-bold py-2 px-4 rounded w-1/2 ml-2">Sign Up</button>
        </div>

        {/* Forgot Password Link */}
        <a className="block text-center text-slate-400" href="#">Forgot Password?</a>
      </form>
    </div>
  );
};

export default LoginPage;
